import Vue from 'vue'
import VueRouter from 'vue-router'
import PaymentPage from '@/views/PaymentPage.vue'

Vue.use(VueRouter)

const routes = [
  {
    path: '/payment',
    name: 'Payment',
    component: PaymentPage
  }
]

const router = new VueRouter({
  mode: 'history',
  base: process.env.BASE_URL,
  routes
})

export default router;
